pragma solidity >=0.8.2 <0.9.0;

contract MyContract {
 event NumberAdded(uint16 a, uint16 b, uint16 result);

function addNumbers(uint16 a, uint16 b) public pure returns (uint16) {
    uint16 result = a + b;
   return result;

   }
function multiplyByTwo(uint16 value) public pure returns (uint16) {
    uint16 result = value * 2;
    return result;
     }

function eventFun(uint16 a, uint16 b)public{
    uint16 result=a+b;
 emit NumberAdded(a, b, result);
}

}
